import React from 'react';

const AdviceCard = ({ advice }) => {
  return (
    <div className='advice-card'>
      <h2>ADVICE #117</h2>
      {advice && <p>{advice}</p>}
      <div className='dice'>
      <img src='/icon-dice.svg' alt='Dice Icon' className='dice' />
      </div>
    </div>
  );
};

export default AdviceCard;
